input = [[




]]

local map = {
    [3] = {1, 2, 3},
    [2] = {4, 5, 6},
    [1] = {7, 8, 9},
}

local x, y, code

local function enter()
    print(x, y)
    code = code .. map[y][x]
end

local function move(dir)
    local nx, ny = x, y
    if     dir == "U" then ny = y + 1
    elseif dir == "R" then nx = x + 1
    elseif dir == "D" then ny = y - 1
    elseif dir == "L" then nx = x - 1
    end
    if map[ny] == nil or map[ny][nx] == nil then return end
    x, y = nx, ny
end

local function solve_map(sx, sy)
    x, y = sx, sy
    code = ""
    local pos = 1
    while pos <= #input do
        char = string.sub(input, pos, pos)
        -----
        if char ~= "\n" then
            move(char)
        else
            enter()
        end
        -----
        pos = pos + 1
    end
    print(code)
end

solve_map(2, 2)
